import './App.css';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";
import Home from './screens/Home';
function App() {
  return (
   <Router>
       <div> 

       <Routes>

        <Route exact path="/" element={<Home/>} />
       </Routes>

       </div>
   </Router>
  );
}

export default App;
